// src/components/Auth/Register.js
import React, { useState, useEffect } from 'react';
import {
    Box,
    Button,
    TextField,
    Typography,
    Container,
    Alert,
    Paper,
    CircularProgress,
    FormControl,
    InputLabel,
    Select,
    MenuItem,
    styled
} from '@mui/material';
import { Link } from 'react-router-dom';
import { supabase } from '../../utils/supabaseClient';

// スタイル付きコンポーネント
const StyledPaper = styled(Paper)(({ theme }) => ({
    marginTop: theme.spacing(4),
    marginBottom: theme.spacing(4),
    padding: theme.spacing(4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: 'white',
    borderRadius: '10px',
    boxShadow: '0 3px 6px rgba(0,0,0,0.1)'
}));

const StyledTextField = styled(TextField)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    '& .MuiOutlinedInput-root': {
        '& fieldset': {
            borderColor: '#e0e0e0',
        },
        '&:hover fieldset': {
            borderColor: theme.palette.primary.main,
        },
    },
}));

const StyledButton = styled(Button)(({ theme }) => ({
    marginTop: theme.spacing(2),
    marginBottom: theme.spacing(2),
    padding: theme.spacing(1.5),
    backgroundColor: '#1a237e',
    '&:hover': {
        backgroundColor: '#000051',
    },
}));

const StyledFormControl = styled(FormControl)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    width: '100%',
}));

export default function Register() {
    // ... 既存のステート管理とロジック ...

    return (
        <Container component="main" maxWidth="sm">
            <StyledPaper elevation={0}>
                <Typography
                    component="h1"
                    variant="h4"
                    sx={{
                        mb: 4,
                        fontWeight: 'bold',
                        color: '#1a237e'
                    }}
                >
                    新規ユーザー登録
                </Typography>

                {error && (
                    <Alert severity="error" sx={{ width: '100%', mb: 2 }}>
                        {error}
                    </Alert>
                )}

                {successMessage && (
                    <Alert severity="success" sx={{ width: '100%', mb: 2 }}>
                        {successMessage}
                    </Alert>
                )}

                <Box component="form" onSubmit={handleSubmit} sx={{ width: '100%' }}>
                    <StyledTextField
                        required
                        fullWidth
                        label="名前（カタカナ）"
                        name="nameKana"
                        value={formData.nameKana}
                        onChange={handleChange}
                        helperText="全角カタカナで入力してください"
                    />

                    <StyledTextField
                        required
                        fullWidth
                        label="希望ユーザーID"
                        name="userId"
                        value={formData.userId}
                        onChange={handleChange}
                        helperText="半角英数6文字以上"
                    />

                    <StyledTextField
                        required
                        fullWidth
                        label="メールアドレス"
                        name="email"
                        type="email"
                        value={formData.email}
                        onChange={handleChange}
                    />

                    <StyledTextField
                        required
                        fullWidth
                        label="パスワード"
                        name="password"
                        type="password"
                        value={formData.password}
                        onChange={handleChange}
                    />

                    <StyledTextField
                        required
                        fullWidth
                        label="パスワード（確認）"
                        name="confirmPassword"
                        type="password"
                        value={formData.confirmPassword}
                        onChange={handleChange}
                    />

                    <StyledTextField
                        required
                        fullWidth
                        label="紹介者ID"
                        name="referralId"
                        value={formData.referralId}
                        onChange={handleChange}
                    />

                    <StyledTextField
                        fullWidth
                        label="USDTアドレス (BEP20)"
                        name="usdtAddress"
                        value={formData.usdtAddress}
                        onChange={handleChange}
                        helperText="0xから始まるアドレスを入力してください"
                    />

                    <StyledFormControl>
                        <InputLabel>ウォレットタイプ</InputLabel>
                        <Select
                            value={formData.walletType}
                            label="ウォレットタイプ"
                            name="walletType"
                            onChange={handleChange}
                        >
                            <MenuItem value="evocard">EVOカード</MenuItem>
                            <MenuItem value="other">その他</MenuItem>
                        </Select>
                    </StyledFormControl>

                    <StyledButton
                        type="submit"
                        fullWidth
                        variant="contained"
                        disabled={loading}
                    >
                        {loading ? <CircularProgress size={24} color="inherit" /> : '登録'}
                    </StyledButton>

                    <Box sx={{ textAlign: 'center', mt: 2 }}>
                        <Link
                            to="/"
                            style={{
                                textDecoration: 'none',
                                color: '#1a237e',
                                fontSize: '0.875rem'
                            }}
                        >
                            既にアカウントをお持ちの方はこちら
                        </Link>
                    </Box>
                </Box>
            </StyledPaper>
        </Container>
    );
}
